import React from 'react';

const PlantInfo = () => {
  return (
    <div>
      <h2>Plant Name</h2>
      <img src="" alt="Plant" />
      <div>
        <div>Latin Name: </div>
        <div>Family: </div>
        <div>Category: </div>
        <div>Style: </div>
        <div>Growth: </div>
      </div>
    </div>
  );
};

export default PlantInfo;
